import { Item } from '../types/Item';

export const items: Item[] = [
    { date: new Date(2022, 4, 11), category: "food", title: "Burger King", value: 45.50 },
    { date: new Date(2022, 4, 12), category: "food", title: "Burger King", value: 15 },
    { date: new Date(2022, 4, 21), category: "rent", title: "Aluguel Apt", value: 600.00 },
    { date: new Date(2022, 4, 16), category: "salary", title: "Salario CODEX", value: 4000 },
];
